import React from 'react';
import MainTabItems from './MainTabItems.js';
import TabItem from './TabItem.js'
import Flight from '../Search/flight.js'
import Hotel from '../Search/hotel.js'
import Car from '../Search/car.js'

class MainTabNav extends React.Component{
  render() {
    const maintabcomponents = MainTabItems.map(item =>
        <TabItem title = {item.title} className = {item.className} url = {item.url} toggle = {item.toggle}/>)
    return (
      <div>
        <ul className="nav nav-tabs">
          {maintabcomponents}
        </ul>
      </div>
    )
  }
}
export default MainTabNav
